function [fit_out,x,err] = FitGammaPow(values_in,measurements,values_out,x0)% [fit_out,x,err] = FitGammaPow(values_in,measurements,values_out,x0)%% Fit power function to gamma data.% Standard minimization sequenceoptions = foptions;options(1) = 1;options(14) = 600;x = constr('FitGammaPowFun',x0,options,[],[],[],values_in,measurements);% Now compute fit values and error to data for returnfit_out = ComputeGammaPow(x,values_out);err = FitGammaPowFun(x,values_in,measurements);